import logo from '../images/logo.svg';
import { Link } from 'react-router-dom';

function Header(props) {
  function renderHomeHeader() {
    return (
      <header className="header">
        <img className="logo" src={logo} id="logo-icon" alt="logo"></img>
      </header>
    );
  }

  function renderRegisterHeader() {
    return (
      <header className="header">
        <img className="logo" src={logo} id="logo-icon" alt="logo"></img>
        <Link className="header__link-btn" to={"/login"}>Log In</Link>
      </header>
    );
  }

  function renderLoginHeader() {
    return (
      <header className="header">
        <img className="logo" src={logo} id="logo-icon" alt="logo"></img>
        <Link className="header__link-btn" to={"/register"}>Sign Up</Link>
      </header>
    );
  }

  if (props.type === 'login') {
    return renderLoginHeader();
  }

  if (props.type === 'register') {
    return renderRegisterHeader();
  }

  return renderHomeHeader();
}

export default Header;
